            "title": "ABOUT",
            "subtitle": "<font class=\"cstm-fnt\" style=\"font-size: 60.01%;\">NETCPT, National Conference on Emerging Trends in Chemical &amp; Petrochemical Technology is an event organized by the department of Petrochemical Technology of University College of Engineering, BIT Campus, Anna University, Tiruchirapalli. It acts as a perfect platform for the Chemical Engineering Students to participate and learn about the ever devolping Chemical Engineering sector.&nbsp;&nbsp;</font>",
            "description": "<b><u>THE INSTITUTION:<br><br></u></b><font class=\"cstm-fnt\" style=\"font-size: 110.1%;\"><font class=\"cstm-fnt\" style=\"font-size: 81.753%;\"><b>Dean: Dr. T. Senthilkumar</b></font><br></font><font class=\"cstm-fnt\" style=\"font-size: 70.01%;\"><font class=\"cstm-fnt\" style=\"font-size: 114.412%;\">University College of Engineering, BIT Campus, Tiruchirapalli, is a  technical university department  of Anna University.  It is located on Tiruchirapalli â€“ Pudukottai National Highway 336, Tamilnadu, India. It was established in the year 1999 as a part of Bharathidhasan University with 5 departments. BIT is now offering 10 undergraduate B.E/B.Tech programmes and 9 post graduate programmes.</font><br></font><font class=\"cstm-fnt\" style=\"font-size: 80.1%;\"><br><b><u><font class=\"cstm-fnt\" style=\"font-size: 124.969%;\">THE DEPARTMENT:<br><br></font></u></b><font class=\"cstm-fnt\" style=\"font-size: 112.484%;\"><b>HOD: Dr. M. Arulmozhi</b></font><br>Department of Petrochemical Technology, University College of Engineering, BIT Campus, Tiruchirappalli is offering B.Tech. Programme in Petrochemical Technology since 1999 with an AICTE approved intake of 60 students. B.Tech., Petrochemical Technology is accredited by NBA for three years from 2018.</font><br>",
